import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import "../../css/Doctor/ddashboard.css";

export default function UploadSchedule() {
  // Dummy schedule data
  const dummySchedule = {
    "slots": [
      [2024, 4, 5, 11, 15],
      [2024, 4, 6, 15, 45],
      [2024, 4, 7, 15, 0],
      [2024, 4, 6, 15, 45],
      [2024, 4, 5, 15, 0]
    ]
  };

  // State for schedule data
  const [schedule, setSchedule] = useState({});

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  useEffect(() => {
    // Function to generate schedule based on dummy data
    const generateScheduleFromDummy = () => {
      const newSchedule = {};

      dummySchedule.slots.forEach(slot => {
        const [year, month, day, hour, minute] = slot;
        const date = new Date(year, month - 1, day);
        const formattedDate = date.toISOString().split('T')[0];
        const time = `${hour}:${minute < 10 ? '0' + minute : minute}`;

        if (!newSchedule[formattedDate]) {
          newSchedule[formattedDate] = {};
        }

        newSchedule[formattedDate][time] = true;
      });

      setSchedule(newSchedule);
    };

    generateScheduleFromDummy();
  }, []);

  // Function to generate empty schedule (for upload mode)
  const generateEmptySchedule = () => {
    const newSchedule = {};

    dummySchedule.slots.forEach(slot => {
      const [year, month, day] = slot;
      const date = new Date(year, month - 1, day);
      const formattedDate = date.toISOString().split('T')[0];
      const timeslots = ['9:00 AM', '9:45 AM', '10:30 AM', '11:15 AM', '12:00 PM', '12:45 PM', '13:30 PM', '14:15 PM', '15:00 PM', '15:45 PM'];

      newSchedule[formattedDate] = {};

      timeslots.forEach(time => {
        newSchedule[formattedDate][time] = false; // All cells grey (unavailable) in upload mode
      });
    });

    return newSchedule;
  };

  const handleUpload = () => {
    setSchedule(generateEmptySchedule()); // Reset schedule to empty for upload
    setIsEditing(true); // Enable editing mode for upload
  };

  // Function to simulate saving the schedule (replace with actual logic)
  const handleSubmit = async () => {
    alert('Saving schedule...');

    // Replace with your actual saving logic (e.g., API call)
    // This example simulates a successful save after 2 seconds
    await new Promise((resolve) => setTimeout(resolve, 2000));

    setIsEditing(false); // Reset edit mode after successful save
  };

  return (
    <div className='dashboard-container'>
      <Navbar />
      <div className= 'dashboard-content'>
        <SideNavbar />
        <div className="main-content">
          <h2>This Week's Schedule</h2>
          <table className="table table-bordered custom-box">
            <thead>
              <tr>
                <th></th>
                <th>9:00 AM</th>
                <th>9:45 AM</th>
                <th>10:30 AM</th>
                <th>11:15 AM</th>
                <th>12:00 PM</th>
                <th>12:45 PM</th>
                <th>13:30 PM</th>
                <th>14:15 PM</th>
                <th>15:00 PM</th>
                <th>15:45 PM</th>
              </tr>
            </thead>
            <tbody>
              {Object.entries(schedule).map(([date, timeslots]) => (
                <tr key={date}>
                  <th scope="row">{date}</th>
                  {Object.entries(timeslots).map(([time, available]) => (
                    <td
                      key={`${date}-${time}`}
                      className={
                        available ? 'table-success bg-success text-white' : 'table-secondary'
                      }
                      onClick={() => (isEditing ? handleCellClick(date, time) : null)}
                    >
                      {isEditing ? '' : time}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
          <button type="button" className="btn btn-primary custom-button" onClick={handleEdit}>
            {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
          </button>
          {isEditing ? (
            <button type="button" className="btn btn-primary custom-button" onClick={handleSubmit}>
              Submit
            </button>
          ) : (
            <button type="button" className="btn btn-success custom-button2" onClick={handleUpload}>
              Upload New Schedule
            </button>
          )}
        </div>
      </div>
    </div>
  );
}
